import React, { Fragment } from "react";
import { Form, Input, Button, Row, Col, Select, DatePicker } from "antd";

const layout = {
  labelCol: { span: 3 },
  wrapperCol: { span: 16 }
};
const tailLayout = {
  wrapperCol: { offset: 8, span: 16 }
};

const { Option } = Select;

const PersonalForm = ({
  firstName,
  lastName,
  gender,
  Address,
  password,
  phoneNumber,
  workPosition,
  age,
  salary,
  email,
  date,
  onClose,
  onhandleAdd
}) => {
  return (
    <Fragment>
      <Form
        {...layout}
        name="basic"
        onFinish={onhandleAdd}
        hideRequiredMark
        className="m-0"
      >
        <Form.Item
          label={firstName}
          name={firstName}
          rules={[{ required: true, message: `Please input ${firstName}` }]}
        >
          <Input allowClear />
        </Form.Item>

        <Form.Item
          label={lastName}
          name={lastName}
          rules={[{ required: true, message: `Please input ${lastName}` }]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label={gender}
          name={gender}
          rules={[{ required: true, message: `Please choose ${gender}` }]}
        >
          <Select>
            <Option value="Male">Male</Option>
            <Option value="Female">Female</Option>
          </Select>
        </Form.Item>
        <Form.Item
          label={fourthItem}
          name={fourthItem}
          rules={[{ required: true, message: `Please input ${fourthItem}` }]}
        >
          <DatePicker className="w-100" />
        </Form.Item>

        <Row>
          <Col span={5}>
            <Form.Item {...tailLayout}>
              <Button type="primary" htmlType="submit">
                Add
              </Button>
            </Form.Item>
          </Col>
          <Col span={5}>
            <Form.Item {...tailLayout}>
              <Button type="danger" onClick={onClose}>
                Cancel
              </Button>
            </Form.Item>
          </Col>
        </Row>
      </Form>
    </Fragment>
  );
};
export default PersonalForm;
